import React from "react";
import ProductCard from "./ProductCard";
import "./ProductGrid.css";

const products = [
  {
    bs_name: "global chair",
    name: "Eero Aarnio Style Ball Chair",
    price: "$890",
    image:
      "http://res.cloudinary.com/dzkfmthai/image/upload/v1498119804/card_img_zghqta.jpg",
  },
  {
    bs_name: "vintage",
    name: "Vintage Leather Sofa",
    price: "$1299",
    image:
      "http://res.cloudinary.com/dzkfmthai/image/upload/v1498119805/card_img_ogeknk.jpg",
  },
  {
    bs_name: "modern",
    name: "Modern Pendant Lamp",
    price: "$199",
    image:
      "http://res.cloudinary.com/dzkfmthai/image/upload/v1498119805/card_img_elpiln.jpg",
  },
];

const ProductGrid = () => {
  return (
    <div className="product-grid">
      {products.map((product) => (
        <ProductCard key={product.name} {...product} />
      ))}
    </div>
  );
};

export default ProductGrid;
